class Solution {
  int minOperations(List<int> nums1, List<int> nums2) {
    int operations = 0;
    // Finding the maximum value in both arrays
    int maxNums1 = nums1.reduce((a, b) => a > b ? a : b);
    int maxNums2 = nums2.reduce((a, b) => a > b ? a : b);

    // Check if swapping is necessary for the last elements to be the max of their respective arrays
    if (nums1.last != maxNums1 || nums2.last != maxNums2) {
      // If the max of nums1 is not at the last position, find where it is and swap if it's beneficial
      if (nums1.last != maxNums1) {
        int indexMaxNums1 = nums1.indexOf(maxNums1);
        if (nums2[indexMaxNums1] > nums1.last) {
          int temp = nums1[indexMaxNums1];
          nums1[indexMaxNums1] = nums2[indexMaxNums1];
          nums2[indexMaxNums1] = temp;
          operations++;
        }
      }
      // If the max of nums2 is not at the last position, find where it is and swap if it's beneficial
      if (nums2.last != maxNums2) {
        int indexMaxNums2 = nums2.indexOf(maxNums2);
        if (nums1[indexMaxNums2] > nums2.last) {
          int temp = nums2[indexMaxNums2];
          nums2[indexMaxNums2] = nums1[indexMaxNums2];
          nums1[indexMaxNums2] = temp;
          operations++;
        }
      }
    }

    // Re-evaluate the conditions after potential swaps
    maxNums1 = nums1.reduce((a, b) => a > b ? a : b);
    maxNums2 = nums2.reduce((a, b) => a > b ? a : b);
    if (nums1.last == maxNums1 && nums2.last == maxNums2) {
      return operations; // Conditions met
    } else {
      return -1; // Conditions cannot be met
    }
  }
}
